import numpy as np
import math

def boxcar_matched_filter(profile, width):
    if len(profile) < width:
        return None

    result = np.zeros(len(profile))

    for i in range(len(profile)):
        sum_val = sum(profile[i:i+width] + profile[:max(0, i+width-len(profile))])
        result[i] = sum_val / math.sqrt(width)

    return result

